import React, { useState } from 'react';
import axios from 'axios';

const SearchFlights: React.FC = () => {
  const [origin, setOrigin] = useState('');
  const [destination, setDestination] = useState('');
  const [departureDate, setDepartureDate] = useState('');
  const [flights, setFlights] = useState<any[]>([]);

  const handleSearch = async () => {
    try {
      const response = await axios.get('/api/flights/search', {
        params: { origin, destination, departureDate }
      });
      setFlights(response.data);
    } catch (error) {
      console.error('Error searching flights:', error);
    }
  };

  return (
    <div>
      <h2>Search Flights</h2>
      <input type="text" value={origin} onChange={(e) => setOrigin(e.target.value)} placeholder="Origin" />
      <input type="text" value={destination} onChange={(e) => setDestination(e.target.value)} placeholder="Destination" />
      <input type="date" value={departureDate} onChange={(e) => setDepartureDate(e.target.value)} />
      <button onClick={handleSearch}>Search</button>
      <ul>
        {flights.map((flight) => (
          <li key={flight.id}>{`Flight ID: ${flight.id}, From: ${flight.origin}, To: ${flight.destination}, Date: ${flight.departureDate}`}</li>
        ))}
      </ul>
    </div>
  );
};

export default SearchFlights;
